<!doctype html>
<html lang="en">
    <head>
        <meta charset="utf-8">
        <title>Website</title>

        <style>
        * {
            font-family: sans-serif;
        }

        html,
        body {
            padding: 0;
            margin: 0;
            height:100%;
            width: 100%;
            background-color: #231f20;
        }

        #textDisplay {
          position: fixed;

          top: 0;
          left: 0;

          font-size: 20px;
          font-weight: bold;
        }

        @keyframes animatetimeline {
          0%{
            transform: translateX(0);
          }
          3%{
            transform: translateX(-200px);
          }
          21%{
            transform: translateX(-4060px);
          }
          41%{
            transform: translateX(-6180px);
          }
          68%{
            transform: translateX(-7580px);
          }
          87%{
            transform: translateX(-9000px);
          }
          97%{
            transform: translateX(-10000px);
          }
          100%{
            transform: translateX(0);
          }
        }
        #timeline{
          height: 100%;
        }

        /* body.playing #timeline{
          animation: animatetimeline 60s linear;
          animation-fill-mode: forwards;
        } */

        circle+text{
          display: none;
          pointer-events:none;
        }
        circle:hover+text{
          display: block;
        }
        #title{
          position: fixed;
          z-index: 1;
          width: 500px;
          top: 60px;
          left: 100px;
        }
        video{
          position: fixed;
          z-index: 2;
          width: 400px;
          bottom: 84px;
          left: 120px;
        }
        #video-background{
          position: fixed;
          z-index: 1;
          width: 420px;
          height: 249px;
          top: 650px;
          left: 111px;
          background-color: #d1d3d4;
        }
        #line{
          position: fixed;
          z-index: 1;
          top: 335px;
          height: 350px;
          width: 3px;
          left: 111px;
          background-color: #d1d3d4;
          }
          #play{
          position: fixed;
          z-index: 1;
          top: 280px;
          left: 110px;
          width: 0;
          height: 0;
          border-top: 18px solid transparent;
          border-bottom: 18px solid transparent;
          border-left: 30px solid #c26055;
          cursor: pointer;
          }

          #play:hover {
            border-left: 30px solid rgb(75, 99, 86);
          }
        #pause {
          position: fixed;
          z-index: 1;
          top: 279px;
          left: 149px;
          width: 24px;
          height: 38px;
          cursor: pointer;
        }
        #pausebar1 {
          position: absolute;
          top: 0;
          left: 0;
          width: 8px;
          height:38px;
          background-color: #d1d3d4;
        }
        #pausebar2 {
          position: absolute;
          right: 0;
          top: 0;
          width: 8px;
          height:38px;
          background-color: #d1d3d4;
        }
        #slider {
          position: fixed;
          z-index: 1;
          height: 14%;
          top: 120px;
          left: 650px;
          }

        #slider-buttons {
          position: fixed;
          z-index: 1;
          height: 50px;
          width: 456px;
          top: 206px;
          left: 640px;
          display: flex;
          justify-content: space-between;

        }

        .slider-btn {
          width: 50px;
          height: 50px;
          cursor: pointer;
        }

        .slider-btn.active {
          background-color: #d1d3d4;
          border-radius: 100%;
        }
        </style>
    </head>

  <script src="https://cdnjs.cloudflare.com/ajax/libs/gsap/1.14.2/TweenMax.min.js"></script>

  <script>
  $("video").on('play', function() {
    if (tl.progress() === 1) {
      tl.restart();
    } else {
      tl.play();
    }
  });

  $("#play").click(function() {
    $("video").get(0).play();
  });
  $("#pause").click(function() {
    $("video").get(0).pause();

    tl.pause();
  });

  var tl = new TimelineMax({
      paused: true
  });
  tl.to('#timeline', 10.5, {
        x: -4060,
        ease: Linear.easeNone
    })
    .to('#timeline', 12.1, {
        x: -6180,
        ease: Linear.easeNone
    })
    .to('#timeline', 16.14, {
        x: -7580,
        ease: Linear.easeNone
    })
    .to('#timeline', 11.18, {
        x: -9000,
        ease: Linear.easeNone
    })
    .to('#timeline', 6.09, {
        x: -12741,
        ease: Linear.easeNone
    })
    .to('#timeline', 3, {
        x: -12745,
        ease: Linear.easeNone,
        clearProps: 'x'
    });

    $(".slider-btn").click(function(e) {
      $(".slider-btn").removeClass("active");
      $(this).addClass("active");
      var position = $(this).data('position');

      if (position == 0) {
        $("#Score, #Dancer_One, #Dancer_Two, #Point_of_Contact, #Left_Hand, #Left_Foot, #Right_Hand, #Right_Foot").hide();
        $("#D1_Left_Foot, #D2_Left_Foot, #D1_Right_Foot, #D2_Right_Foot, #D1_Left_Hand, #D2_Left_Hand, #D1_Right_Hand, #D2_Right_Hand").show();
      }

      if (position == 1) {
        $("#Score, #Dancer_One, #Dancer_Two").hide();
        $("#Point_of_Contact, #Left_Hand, #Right_Hand, #Left_Foot, #Right_Foot, #D1_Left_Foot, #D2_Left_Foot, #D1_Right_Foot, #D2_Right_Foot, #D1_Left_Hand, #D2_Left_Hand, #D1_Right_Hand, #D2_Right_Hand").show();
      }

      if (position == 2) {
        $("#Dancer_One, #Dancer_Two").hide();
        $("#Score,#Point_of_Contact, #Left_Hand, #Right_Hand, #Left_Foot, #Right_Foot, #D1_Left_Foot, #D2_Left_Foot, #D1_Right_Foot, #D2_Right_Foot, #D1_Left_Hand, #D2_Left_Hand, #D1_Right_Hand, #D2_Right_Hand").show();
      }

      if (position == 3) {
        $("#Dancer_One, #Dancer_Two, #Score,#Point_of_Contact, #Left_Hand, #Right_Hand, #Left_Foot, #Right_Foot, #D1_Left_Foot, #D2_Left_Foot, #D1_Right_Foot, #D2_Right_Foot, #D1_Left_Hand, #D2_Left_Hand, #D1_Right_Hand, #D2_Right_Hand").show();
      }

    });
  </script>
